import React, { Component } from "react";
import axios from "axios";

class FavorBtn extends Component {
  constructor(props) {
    super(props);
  }

  handleClick = () => {
    let url =
      "http://127.0.0.1:8000/favor?question=${this.props.question}&answer=${this.props.answer}";
    axios
      .get(url)
      .then(function(response) {
        let data = response.data;
        alert(data);
      })
      .catch(function(error) {
        console.log(error);
      });
  };

  render() {
    return <button onClick={this.handleClick}>favor</button>;
  }
}

export default FavorBtn;
